                  enable: true,
                  area: 800,
                },
                value: 80,
              },
              opacity: {
                value: 0.5,
              },
              shape: {
                type: "circle",
              },
              size: {
                random: true,
                value: 5,
              },
            },
            detectRetina: true,
          }}
        />
        <Navigation />
        <div>
          <Logo />
        </div>
        <Rank />
        <ImageLinkForm onInputChange={this.onInputChange} />
        {/*
        <FaceRecognition /> */}
      </div>
    );
  }

export default App;
